package com.example.userschool.model;public class Teacher {    private int id;    private String name;    private String password;    private String className;    private String subjectID;    public Teacher(int id, String name, String className) {        this.id = id;        this.name = name;        this.className = className;    }    public Teacher() {    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public String getClassName() {        return className;    }    public void setClassName(String className) {        this.className = className;    }    public String getSubjectID() {        return subjectID;    }    public void setSubjectID(String subjectID) {        this.subjectID = subjectID;    }}